 Director Robby D
 Starring Samantha Ryan, Skin Diamond, Dani Daniels, Kayden Kross, Karlie Montana, Kiera Winters, Bree Daniels, Layla Rose, Brett Rossi, Raven Rocket

 Written, Directed, And Starring Kayden Kross!

 Five Tales Of Love, Lust And Loss!

 Digital Playground contract star Kayden Kross takes viewers on a journey of sapphic proportions, where making up means getting naked in 5 tales of love, lust, and loss. First, mourning turns to passion when Kiera Winters and Raven Rockette works out their differences at a funeral. Next, playful teens Brett Rossi and Karlie Montana indulge in their fist lesbian experience.


